	innerHtml:	"<div name=\"dCon\" style=\"position: absolute; left: 0px; top: 0px; border: 1px solid rgb(0, 0, 0); width: 509px; height: 292px; background-color: rgb(19, 79, 92);\"><div name=\"dCon2\" class=\"ttxt\" style=\"left: 5px; top: 5px; width: 501px; height: 284px;\"><p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">​</span></p>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">For å reflektere over eigen&nbsp;læringsprosess&nbsp;skal du gjere&nbsp;følgjande:</span></p>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">​</span></p>\n\n<ul style=\"padding-left: 17px; padding-inline-start: 17px;\">\n	<li style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">Skriv ned 3&nbsp;ting du har lært.</span></li>\n	<li style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">Skriv ned 3&nbsp;ting du ønskjer å lære meir om<span style=\"caret-color: rgb(255, 255, 255);\">.</span></span></li>\n	<li style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">Skriv ned 3 ting <u>DU</u> kan gjere for å løyse plastproblemet.</span></li>\n</ul>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">​</span></p>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">Som avslutning skal du gjennomføre ein liten test, for å sjå kva du har fått med deg av&nbsp;</span><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">faginnhaldet. Du finn testen ved å klikke på den høgre knappen&nbsp;i nedre høgre hjørne. </span></p>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">​</span></p>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">Lykke til!</span></p>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; font-size:12pt; color: rgb(255, 255, 255);\">​</span></p>\n\n<p style=\"text-align: left;\"><span style=\"font-family: Arial, sans-serif; color: rgb(255, 255, 255); font-size:12pt;\">​</span></p>\n\n<p style=\"text-align:left\"></p></div></div>",
